Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000002,'스위트홈','한국',2020,'철거 직전의 아파트, 그린홈으로 이사 온 지 일주일. 집에만 틀어박혀 지내던 현수는 무섭게 돌변한 주민을 목격한다. 내가 먼저 사라지려고 했는데, 세상이 먼저 망했다.','18',1,null,'true');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000003,'나쁜녀석들 악의도시','한국',2018,'타협은 없다. 용서도 없다. 썩은 놈들이 판치는 대한민국, 그놈들 잡으러 나선 나쁜녀석들의 통쾌한 한 방! 검사는 판을 짜고 조폭과 형사는 발로 뛰니, 전쟁은 시작됐다.','15',1,null,'false');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000004,'비밀의숲','한국',2020,'공감 능력을 잃은 검사가 살인 사건을 파헤친다. 검사는 열혈 여형사의 도움을 받으며, 수사를 방해하는 부패한 정치 상황에 맞선다.','15',2,null,'false');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000005,'뤼팽','프랑스',2021,'그가 오늘 밤 큰 한바탕을 노린다. 훔질 물건은 루브르 경매에 나올 마리 앙투아네트의 목걸이. 최고의 박물관을 뚫을 트릭과 반전은 이미 준비되었다. ''빚''을 청산할 계획도.','15',2,null,'true');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000006,'킹덤','한국',2020,'병든 왕을 둘러싸고 흉흉한 소문이 떠돈다. 어둠에 뒤덮인 조선, 기이한 역병에 신음하는 산하. 정체 모를 악에 맞서 백성을 구원할 희망은 오직 세자뿐이다.','18',2,null,'true');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000007,'퍼니셔','미국',2019,'범죄자들의 손에 가족을 잃은 전직 해병. 그가 세상에 나왔다, 스스로 정의가 되어 악인을 응징하고자. 아무리 거대한 권력이 나서도, 그의 복수를 막을 자, 세상에 없다.','18',2,null,'true');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000008,'블랙미러','미국',2019,'눈부시게 발전한 첨단 기술. 하지만 인간의 어두운 본능이 그 기술을 이용하면서, 기이한 악몽이 시작된다. ''디지털 시대의 <<환상 특급>>'' 이라 불리는 SF 시리즈.','18',5,null,'true');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000009,'얼터드카본','미국',2020,'250년 전에 죽음으로 봉인된 죄수. 그가 새로운 육체를 얻어 되살아난다. 이제 부활의 대가를 치를 순간. 비밀과 음모의 미궁 속에서, 기이한 살인 사건을 해결해야 한다.','18',2,null,'true');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000010,'어둠속으로','벨기에',2021,'그 무엇도 태양광을 막을 수 없다. 햇빛에 닿는 순간 죽음뿐. 기이한 우주 현상이 빚어낸 광선을 피하려면 밤 시간대의 지역으로 달아나야만 한다. 납치된 야간 비행기에 탑승한 승객들이 태양에 쫓겨, 멈출 수 없는 도주를 시작한다.','15',2,null,'true');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000011,'신세계로부터','한국',2021,'유토피아 섬 ''신세계''에서 가상 자금을 받아 6일간 머무르는 여섯 연예인…','12',null,null,'true');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (200000049,'크리스마스 캐슬','미국',2021,'논란에 휩쌰여 스코틀랜드로 여행을 떠난 유명 베스트셀러 작가. 꿈에 그리던 성을 보고 당장 사려 하지만, 까칠한 성주인이 쉽게 내주질 않는다…','12',null,null,'true');
Insert into SUOPA.NF_CONTENTS (CONTENTS_ID,TITLE,COUNTRY,RELEASE_YEAR,CONTENTS_INTRO,AGE_LIMIT,TOTAL_SEASON,RUNNING_TIME,ORIGINAL) values (100000012,'지옥','한국',2021,'어느 날 기이한 존재로부터 지옥행을 선고받은 사람들..','18',1,null,'true');
